import { useState } from "react";
import { useHistory } from "react-router";
import TextField from "@material-ui/core/TextField";
import './index.css'

function CourseRate() {
    let history = useHistory();
    const [professorName, setProfessorName] = useState([])
    const [professorTitle, setProfessorTitle] = useState([])
    const [professorEmail, setProfessorEmail] = useState([])

    const clickEntry = () => {
        console.log(professorName+professorTitle+professorEmail)
        history.push('/dashboard')
    }

    return (
        <div className="courseRateForm">
            <h2>Create a new comment and rate for a course</h2>
            <a href="/dashboard">Go back to course comments page </a>
            <div>
                <TextField
                    name="professorname"
                    label="Professor Name"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setProfessorName(e.target.value)}
                />
            </div> 
            <div>
                <TextField
                    name="title"
                    label="Prefessor Title"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setProfessorTitle(e.target.value)}
                />
            </div>
            <div>
                <TextField
                    name="email"
                    label="Professor Email"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setProfessorEmail(e.target.value)}
                />
            </div>
            <button className="small green button" onClick={clickEntry}>
                Complete
            </button>
        </div>
    );
  }

  export default CourseRate;
